import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';

export default function Signup() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const [rememberMe, setRememberMe] = useState(false);
  const [error, setError] = useState('');
  const navigate = useNavigate();

  const handleSignup = async (e) => {
    e.preventDefault();
    setError(''); // Clear previous errors

    if (password !== confirmPassword) {
      setError('Passwords do not match.');
      return;
    }

    try {
      // Replace with your actual backend signup endpoint
      const response = await fetch('YOUR_BACKEND_SIGNUP_ENDPOINT', { 
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ email, password }),
      });

      const data = await response.json();

      if (response.ok) {
        // Optionally, if your backend returns a token on signup, you can save it
        // localStorage.setItem('token', data.token); 
        // Or directly navigate to login, assuming they log in after signup
        navigate('/login'); 
        alert('Signup successful! Please log in.'); // Simple alert for now
      } else {
        setError(data.message || 'Signup failed. Please try again.');
      }
    } catch (err) {
      setError('Network error or server unavailable.');
      console.error('Signup error:', err);
    }
  };

  return (
    <div 
      className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-400 to-green-500 p-4"
    >
      <div className="bg-white p-8 sm:p-10 rounded-3xl shadow-xl w-full max-w-sm text-center">
        <h2 className="text-4xl font-extrabold text-gray-800 mb-8">Sign Up</h2>

        {error && <p className="text-red-500 mb-4">{error}</p>}

        <form onSubmit={handleSignup} className="space-y-4">
          <input
            type="email"
            placeholder="e-mail"
            className="w-full p-4 rounded-xl border border-gray-200 focus:ring-2 focus:ring-blue-300 focus:outline-none text-gray-700 placeholder-gray-400"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
          />
          <input
            type="password"
            placeholder="password"
            className="w-full p-4 rounded-xl border border-gray-200 focus:ring-2 focus:ring-blue-300 focus:outline-none text-gray-700 placeholder-gray-400"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
            required
          />
          <input
            type="password"
            placeholder="repeat password"
            className="w-full p-4 rounded-xl border border-gray-200 focus:ring-2 focus:ring-blue-300 focus:outline-none text-gray-700 placeholder-gray-400"
            value={confirmPassword}
            onChange={(e) => setConfirmPassword(e.target.value)}
            required
          />

          <div className="flex items-center justify-start mt-4">
            <input
              type="checkbox"
              id="rememberMe"
              className="form-checkbox h-4 w-4 text-blue-600 rounded-md border-gray-300 focus:ring-blue-500 cursor-pointer"
              checked={rememberMe}
              onChange={(e) => setRememberMe(e.target.checked)}
            />
            <label htmlFor="rememberMe" className="ml-2 text-gray-600 text-sm">
              Remember me
            </label>
          </div>

          <p className="text-gray-500 text-sm mt-6 mb-4">Sign up with social account</p>

          {/* Social Icons - these are simple colored circles for now */}
          <div className="flex justify-center space-x-3 mb-8">
            <div className="w-10 h-10 rounded-full bg-red-400 flex items-center justify-center cursor-pointer hover:opacity-80 transition"></div>
            <div className="w-10 h-10 rounded-full bg-blue-400 flex items-center justify-center cursor-pointer hover:opacity-80 transition"></div>
            <div className="w-10 h-10 rounded-full bg-yellow-400 flex items-center justify-center cursor-pointer hover:opacity-80 transition"></div>
          </div>

          <button
            type="submit"
            className="w-full bg-gradient-to-r from-blue-500 to-green-400 hover:from-blue-600 hover:to-green-500 text-white font-bold py-4 rounded-xl transition duration-300 ease-in-out shadow-lg transform hover:-translate-y-1"
          >
            Sign up
          </button>
        </form>

        <p className="text-gray-500 text-xs mt-6">
          <Link to="/license-agreement" className="hover:underline">
            Read User License Agreement
          </Link>
        </p>
      </div>
    </div>
  );
}
